import React from 'react'

const TaskList =({allTasks})=> {
  console.log(allTasks);

  return(
    <div className="taskList">
      {allTasks.map((item,index)=> 
        <p key={index+2}>{item} </p>
      )}
    </div>
  )
}


export default TaskList;
